import React , { useState } from 'react';

import cont from '../../assets/images/items/cont.png';
const Responsive = () => {

    const [data] = useState(
        {
            subtitle: 'Responsive',
            title: 'NOS ENCARGAMOS DE TODO',
            desc1: 'Accesible de todos los dispositivos',
            desc2: 'Celulares, tablets, notebooks, pc',
        }
    )

  return (
    <section className="tf-section servicesvjvj">
                <div className="container">
                    <div className="row">
                        <div className="col-xl-5 col-md-12">
                            <div className="block-text pt-12">
                                <h5 className="sub-title mb-10" data-aos="fade-up" data-aos-duration="1000">EN 5 PASOS</h5>
