                        <div className="col-xl-7 col-md-12">
                            <div className="group-image" data-aos="flip-right"
                                data-aos-easing="ease-out-cubic"
                                data-aos-duration="2000">
                                <img src={cont} alt="cont" />
                            </div>
                        </div>
                    </div>
                </div>
            </section>
  );
}

export default Responsive;
